import React from 'react';
import classes from './Main.module.css';
import bg1 from '../../assets/image_part_001.jpg';
import bg2 from '../../assets/image_part_002.jpg';
import bg3 from '../../assets/image_part_003.jpg';
import bg4 from '../../assets/image_part_004.jpg';

const main = (props) => {
    return (
        <div className={classes.Main} >
            <div className={classes.img1} style={{backgroundImage:url(bg1)}}>
            </div>
            <div className={classes.img2} style={{backgroundImage:bg2}}>
            </div>
            <div className={classes.img3} style={{backgroundImage:bg3}}>
            </div>
            <div className={classes.img4} style={{backgroundImage:bg4}}>
            </div>
        </div>
    );
}

export default main;
